    CSDR_1X_CCCH_FRAME_SIZE_ENUM_UINT16 enFrameSize;
    PHY_UINT16                          uhwWalshLength;       /**< Range(16, 32, 64 or 128), see above */
    PHY_UINT16                          uhwWalshIndex;        /**< Range(1..256). Used range depends on enCCCH_Rate and enCCCH_CodeRate. From FCCCH_CODE_CHAN */
    PHY_UINT16                          uhwReserved1;         /**< Reserved() 32 bit alignment */
