    PHY_INT32                           swFchSetPoint;   /**< Range(-2097152..2080768) Validity(enOlpcFchFlag=CSDR_1X_TRUE), resolution 1/16384dB. OLPC setpoint for F-FCH */
    PHY_INT32                           swDcchSetPoint;  /**< Range(-2097152..2080768) Validity(enOlpcDcchFlag=CSDR_1X_TRUE), resolution 1/16384dB. OLPC setpoint for F-DCCH */
